            </Content>
            <div>
                <img src="./images/doctor.jpg" alt="" />
            </div>

        </Bodycard>
    )
}

const Bodycard = styled.div`
display: flex;
flex-direction: row;
justify-content: space-between;


img {
    max-width:40px;
    height:auto;
}

`
const Content = styled.div`
color: #033B4A;
`

export default Body;
